/*
pro info 完善的路由容器组件
*/

import React from 'react'
import {connect} from 'react-redux'

import {
    NavBar,
    InputItem,
    TextareaItem,
    Button
} from 'antd-mobile'
import AvatarSelector from '../../components/avatar-selector/avatar-selector'



class ProInfo extends React.Component {
    render() {
        return (
            <div>
                <NavBar> Your Pro Info </NavBar>
                <AvatarSelector/>

                <InputItem placeholder='league main race'>Main Race: </InputItem>
                <InputItem placeholder='league ranking'>Ranking: </InputItem>
                <TextareaItem title="Summary: "
                                        rows={5} />
                <Button type='primary'> Save </Button>

            </div>
        )
    }
}


export default connect(
    state => ({}),
    {}
)(ProInfo)
